import React from 'react';
import ReactDOM from 'react-dom';
import Carouselitem from '../../../General/Carousel/carouselitem.js';
import Carouselindicator from '../../../../General/Carousel/carouselindicator.js';
import Carouselitems from './carouselitems.js';
import '../carousel.css'


class MyCarousel extends React.Component{
  render() {
    const carouselitems = Carouselitems.map(oneitem =>
        <Carouselitem
           imgName = {oneitem.imgName}
           imgsrc = {oneitem.imgsrc}
           imgalt = {oneitem.imgalt}
           caption = {oneitem.caption}
           href = {oneitem.href}
         />)
   const carouselindicators = Carouselitems.map(oneitem =>
     <Carouselindicator
     target = {oneitem.indicators.target}
     slideto = {oneitem.indicators.slideto}
     indclassName = {oneitem.indicators.indclassName}
     />
       )
    return (
      <div id={this.props.id} className={this.props.class} data-ride={this.props.data}>
        <ul className="carousel-indicators text-center">
          {carouselindicators}
        </ul>
        <div className="carousel-inner mt-3 mb-2">
          {carouselitems}
        </div>
        <a className="carousel-control-prev" href={this.props.href} data-slide="prev">
          <span class="carousel-control-prev-icon"></span>
        </a>
        <a className="carousel-control-next" href={this.props.href} data-slide="next">
          <span className="carousel-control-next-icon"></span>
        </a>
      </div>
    )
  }
}
export default MyCarousel
